import React, { useState } from 'react';
import { Proof } from './types/proof';
import { useNavigate } from 'react-router-dom';
import { DataRequest } from './types/data_request';

const DataProviderPanel: React.FC = () => {
  const [dataRequestId, setDataRequestId] = useState<string>('');
  const [dataRequest, setDataRequest] = useState<DataRequest | null>(null);
  const [value, setValue] = useState<number | ''>('');
  const [proofs, setProofs] = useState<Proof[]>([]);
  const navigate = useNavigate();

  const searchDataRequest = async () => {
    if (!dataRequestId) return;
    try {
      const response = await fetch(
        `http://localhost:3001/data-request/${dataRequestId}`,
        {
          method: 'GET',
          headers: { 'Content-Type':'application/json'}
        }
      );
      if (response.status === 200) {
        setDataRequest(await response.json());
      } else {
        alert('Data Request not found')
      }
    } catch (error) {
      console.error('Failed to fetch proofs:', error);
    }
  };

  const handleSubmit = async () => {
    if (value === '') {
      alert('Please enter a value.');
      return;
    }

    try {
      await fetch('http://localhost:3001/data-response', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          data_request_id: dataRequestId,
          user_id: 'dp123',
          data_type: 'blood_pressure',
          value
        })
      });
      setValue('');
      fetchProofs();
    } catch (error) {
      console.error(error);
    }
  };

  const handleDownload = (item: Proof) => {
    const blob = new Blob([JSON.stringify(item, null, 2)], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `${item.id}.json`;
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <div style={{ position: 'absolute', top: '20px', left: '20px' }}>
        <button
          onClick={() => navigate('/')}
          style={{
            padding: '6px 12px',
            borderRadius: '4px',
            fontSize: '14px',
            backgroundColor: '#ccc',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          ‚Üê Back
        </button>
      </div>
      <h2>Data Provider</h2>
      <h4>data type: blood_pressure</h4>

      <div style={{ margin: '20px' }}>
        <label>data_request_id: </label>
        <input
          type="text"
          value={dataRequestId}
          onChange={(e) => setDataRequestId(e.target.value)}
        />
        <button
          onClick={searchDataRequest}
          style={{
            marginLeft: '10px',
            padding: '8px 16px',
            borderRadius: '6px',
            fontSize: '14px',
            backgroundColor: '#1976d2',
            color: 'white',
            border: 'none',
            cursor: 'pointer'
          }}
        >
          Search
        </button>
      </div>

      {proofs.length > 0 && (
        <>
          <div style={{ margin: '20px' }}>
            <label>value: </label>
            <input
              type="number"
              value={value}
              onChange={(e) => setValue(Number(e.target.value))}
            />
            <button
              onClick={handleSubmit}
              style={{
                marginLeft: '10px',
                padding: '8px 16px',
                borderRadius: '6px',
                fontSize: '14px',
                backgroundColor: '#388e3c',
                color: 'white',
                border: 'none',
                cursor: 'pointer'
              }}
            >
              Submit
            </button>
          </div>

          <ul style={{ marginTop: '40px', listStyle: 'none', padding: 0 }}>
            {proofs.map((item) => (
              <li key={item.id} style={{ textAlign: 'left', margin: '10px auto', border: '1px solid #ccc', padding: '10px', width: '60%', borderRadius: '6px' }}>
                <p><strong>ID:</strong> {item.id}</p>
                <p><strong>Data Request ID:</strong> {item.data_request_id}</p>
                <p><strong>Created At:</strong> {new Date(item.created_at).toLocaleString()}</p>
                <button
                  onClick={() => handleDownload(item)}
                  style={{
                    marginTop: '10px',
                    padding: '6px 12px',
                    borderRadius: '4px',
                    backgroundColor: '#1976d2',
                    color: 'white',
                    border: 'none',
                    cursor: 'pointer'
                  }}
                >
                  Download
                </button>
              </li>
            ))}
          </ul>
        </>
      )}
    </div>
  );
};

export default DataProviderPanel;
